description:
Hardcore Phonography brings you the very best Hip Hop, Funk, House, Trip Hop, Jungle, Old Hardcore and Reggae without the chit chat. Episodes are released on the 1st and 15th of each month and usually cover one specific genre. There are currently 2 resident DJs, Phonowon and DJ 3rd Eye, mixing it up for you twice monthly. More DJs and guest episodes will be added along the way so if you dont like what you here this time, try us again and you just might!!!

Episodes 1 to 10 in .mp3 format

